import { useReducer } from "react";

const INITIAL_STATE = [
    {
        id: 1,
        task: "read",
        complete: false,
    },
    {
        id: 2,
        task: "work out",
        complete: false,
    },
];

const Playgorund = () => {
    return (
        <div className="w-full h-screen flex flex-col justify-center items-center bg-white-100">
            <h1 className="text-xl font-bold">
                This page is for testing purposes
            </h1>
        </div>
    );
};

export { Playgorund };
